import linkedin from "./linkedin.png"
import github from "./github.png"
import './Contacto.css';

function Contacto() {
  return (

          <div className="contacto">

            <h1> VALERIA HOSTOS ALVAREZ </h1>

              <p>
                Me gusta sacar la mejor versión de los proyectos, la exploración de las herramientas tecnológicas
               en las que tengo conocimiento, mi objetivo es conseguir trabajos bien hechos y que lleguen a excelente 
               término, teniendo en cuenta el valor agregado sin caer en excesos

              </p>


            <a href="https://www.linkedin.com/checkpoint/lg/login?trk=reset_password"><img src={linkedin} alt="imagen linkedin" width="100px"></img></a>
            <a href="https://github.com/"><img src={github} alt="imagen github"  width="100px"></img></a>

          </div>
   );
}

export default Contacto;
